G1 E-2 F2700 	 ; Retract a bit
G1 E-2 Z3 F2400   ; Retract and raise Z
G1 X5 Y5 F3000 	 ; Wipe out
G1 Z10 			 ; Raise Z more
G90
G1 X5 Y{print_bed_max[1]*0.85} F{travel_speed*60} ; present print


